import Container from "react-bootstrap/esm/Container";
import mySkills from "./MySkills";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import SkillItem from './SkillItem'

Object.keys(mySkills).map((key) => {
    Object.keys(mySkills[key]).map((innerKey) => {
        console.log(`${key}: ${innerKey} : ${mySkills[key][innerKey]}`)
    })
    console.log('------------------')
})



function Skills() {

    


    return (

        <section className = 'myskills-section Poppins'>
            <Container fluid>

            <Col className ='myskills-header text-center text-uppercase '>
                <h1>My Skills</h1>
            </Col>

            
            {
                Object.keys(mySkills).map((key) => {
                   return Object.keys(mySkills[key]).map((innerKey) => {
                        return <SkillItem name = {mySkills[key][innerKey]} img= {mySkills[key][innerKey]} />
                    })
                    
                })
                
            }
                   
                
            
            
            <br /><br /><br /><br /><br /><br /> <br /><br /><br /><br /><br /><br />
            </Container>
        </section>


    )



}

export default Skills;
